INSERT INTO `elgg_metastrings` VALUES (1,'email'),(2,'webmaster@elgg.org'),(3,'notification:method:email'),(4,'1'),(5,'validated'),(6,'validated_method'),(7,'admin_user'),(8,'webmaster@195.251.195.120'),(9,'admin_notice_id'),(10,'cannot_startelgg-chat-master'),(11,'disable_reason'),(12,'uservalidationbyemail_new_user'),(13,'0'),(14,''),(15,'toId'),(16,'44'),(17,'fromId'),(18,'35'),(19,'readYet'),(20,'hiddenFrom'),(21,'hiddenTo'),(22,'msg'),(23,'unread_messages'),(24,'cannot_startSpecial Profile'),(25,'status'),(26,'published'),(27,'comments_on'),(28,'On'),(29,'excerpt'),(30,'blah'),(31,'80'),(32,'cannot_startelgg-videochat-tinychat-1.8-master'),(33,'tags'),(34,'filename'),(35,'file/1366368843d3.3.1 - detailed description and system design.pdf'),(36,'mimetype'),(37,'application/pdf'),(38,'originalfilename'),(39,'D3.3.1 - Detailed description and system design.pdf'),(40,'simpletype'),(41,'document'),(42,'filestore::dir_root'),(43,'C:/xampp/htdocs/elgg_data/'),(44,'filestore::filestore'),(45,'ElggDiskFilestore'),(46,'room'),(47,'njn8hl'),(48,'njnau2'),(49,'telecardiology@elgg.com'),(50,'nl7inx'),(51,'briefdescription'),(52,'interests'),(53,'diagnosis'),(54,'ECG assessment'),(55,'blog_enable'),(56,'yes'),(57,'bookmarks_enable'),(58,'file_enable'),(59,'activity_enable'),(60,'forum_enable'),(61,'pages_enable'),(62,'membership'),(63,'group_acl'),(64,'3'),(65,'icontime'),(66,'1366635205'),(67,'<p>what should we do????</p>'),(68,'generic_comment'),(69,'file/1366635520index.jpg'),(70,'image/jpeg'),(71,'index.jpg'),(72,'image'),(73,'1366635520'),(74,'thumbnail'),(75,'file/thumb1366635520index.jpg'),(76,'smallthumb'),(77,'file/smallthumb1366635520index.jpg'),(78,'largethumb'),(79,'file/largethumb1366635520index.jpg'),(80,'address'),(81,'http://www.dmsjournal.com/content/2/1/44'),(82,'<p>You review the elevated BP readings with Betty and indicate that these do suggest that she has hypertension; however, she remains reluctant to accept this. You counsel her on lifestyle modifications and schedule a follow-up visit to see her in 3 months.</p>'),(83,'<p>Betty, a 32-year-old African American woman, presents to your office for a second opinion about her blood pressure (BP). She was diagnosed with hypertension approximately 6 months ago and was prescribed amlodipine (5 mg once daily). While taking this agent, she experienced leg edema; she then discontinued the amlodipine.</p>\r\n<p>She informs you that she is not convinced she has hypertension because she has had normal BP readings at her local pharmacy. Considering her young age, she is also concerned about having to take medication for the rest of her life. Her medical, social, and family history and physical examination/laboratory findings are summarized in Table 1. She is not pregnant but is planning to have children in the near future.</p>'),(84,'blog_revision'),(85,'unsaved_draft'),(86,'Paul is a 50-year-old man with stage 3b chronic kidney disease (CKD; glomerular filtration rate [GFR] 44 mL/min per 1.73 m2) who presents for a biannual checkup. He is mildly obese (body mass index [BMI], 32), with a medical history that shows a...'),(87,'new_post'),(88,'<p>Paul is a 50-year-old man with stage 3b chronic kidney disease (CKD; glomerular filtration rate [GFR] 44 mL/min per 1.73 m<sup>2</sup>) who presents for a biannual checkup. He is mildly obese (body mass index [BMI], 32), with a medical history that shows a 5-year history of insulin-dependent type 2 diabetes (poorly-controlled; hemoglobin A<sub>1c</sub> [HbA<sub>1c</sub>] 8.0%), and hypertension and hypercholesterolemia diagnosed 7 years previously. Paul is currently on a calcium channel blocker (CCB) for his hypertension (verapamil SR 180 mg/day) and a statin (atorvastatin 40 mg/day) for his high cholesterol. At the time of this visit, his blood pressure appears to be well controlled (120/85 mm Hg) and previous blood work shows a low-density lipoprotein (LDL) cholesterol level of 120 mg/dL. Biochemical tests show the following: serum calcium 8.9 mg/dL, serum phosphorus 4.8 mg/dL, and serum intact parathyroid hormone (iPTH) 100 pg/mL.</p>\r\n<p>Paul\'s family history is positive for heart disease -- his father died from a myocardial infarction (MI) at the age of 62 years -- and his mother has osteoporosis and cardiovascular disease. He also has 2 siblings, both men, each of whom has insulin-dependent diabetes with hypertension and high cholesterol.</p>'),(89,'blog_auto_save'),(90,'http://cjasn.asnjournals.org/content/7/4/632.long'),(91,'file/1366636667blood_test_results1.jpg'),(92,'blood_test_results1.jpg'),(93,'1366636667'),(94,'file/thumb1366636667blood_test_results1.jpg'),(95,'file/smallthumb1366636667blood_test_results1.jpg'),(96,'file/largethumb1366636667blood_test_results1.jpg'),(97,'<p>&Delta;&omicron;&upsilon;&lambda;&epsilon;ύ&omicron;&upsilon;&nu; &tau;&alpha; comments &sigma;&tau;&alpha; &epsilon;&lambda;&lambda;&eta;&nu;&iota;&kappa;ά;</p>'),(98,'collections_notifications_preferences_site'),(99,'-1'),(100,'notification:method:site'),(101,'a patient with severe angina will be there in about 13:00 CET'),(102,'messageboard'),(103,'<p>&nu;&alpha;&iota;</p>'),(104,'2'),(105,'4'),(106,'Bill'),(107,'write_access_id'),(108,'<p>Bill is a patient......</p>'),(109,'page'),(110,'cannot_startElgg-Event-Calendar-master'),(111,'fellowauthors'),(112,'Alatishe, A'),(113,'Ammori, B J'),(114,'New, J P'),(115,'Syed, A A'),(116,'New, P W'),(117,'McFarlane, C L'),(118,'New, Roger'),(119,'Bansal, Gurpal S'),(120,'Bogus, Michael'),(121,'Zajkowska, Kasia'),(122,'Rickelt, Steffen'),(123,'Toth, Istvan'),(124,'New, Karl J'),(125,'Reilly, Michael E'),(126,'Templeton, Kath'),(127,'Ellis, Gethin'),(128,'James, Philip E'),(129,'Mceneny, Jane'),(130,'Penney, Michael'),(131,'Hooper, James'),(132,'Hullin, Dave'),(133,'Davies, Bruce'),(134,'Bailey, Damian M'),(135,'New, Peter W'),(136,'Jolley, Damien J'),(137,'Cameron, Peter A'),(138,'Olver, John H'),(139,'Stoelwinder, Johannes U'),(140,'Haider, Shozeb'),(141,'Islam, Bari